import React from "react";
import { motion } from "framer-motion";

const modal = (props) => {
    return (
        <section class="modal warning">
        <img src="src/img/failed.png" alt="Failed" class="modal__img" />
        <h3 class="modal-header">Reminder for everyone</h3>
        <p class="modal-info">
          The following program isn't perfect. <br/>So if there are bugs please contact the SS Developers
        </p>
        <button class="btn-understand btn">
          I Understand the possible consequences
        </button>
      </section>
    );
}

export default modal;
